import React from 'react';
import '../Styles/Account.css';
function Account () {
    return (
        <div class="account">
            <p>Account</p>
            <div>
            <form>
                <label for="Login">Login</label><br> </br>
            </form>
            </div>
        </div>
    );
}

export default Account;
